Você encontra as seguintes categorias:
- Aperitivos light.;
- Carnes light.;
- Cremes e sopas light;
- Doces e bolos light;
- Frangos light;
- Frutos do mar light;
- Massas light;
- Ovos light;
- Saladas light;
- Pizzas e tortas light;
- Sanduíches light;
- Sucos light.

Não perca tempo e baixe gratuitamente um dos melhores aplicativos de receitas light do Brasil!!

Obs: Toda semana serão adicionadas novas receitas.
